import React from 'react';
import Button from './Button';
import './App.css';

function App() {
  const playSound = () => {
    console.log('Playing a sound!');
    // In a real app, this would play an audio file
  };

  return (
    <div className="App">
      <header className="App-header">
        <h1>Simple DJ App</h1>
        <Button text="Play Sound" onClick={playSound} />
      </header>
    </div>
  );
}

export default App;
